import React, { useState,useEffect } from "react";



function Clothing()
{
  const [apiArray,setApiArray]=useState([]);
  const fetchApi=()=>{fetch('https://fakestoreapi.com/products').then((res1)=>{return res1.json()}).then((res11)=>setApiArray(res11));}
  return(

    <>
    {fetchApi()}
     CLOTHING WEBSITE..
     </>
  )
}

export default Clothing;
